import axios from "axios";

const USERDATA_API_BASE = "http://localhost:8080/api/v1/userData/";
const USERDATA_API_BASE_URL = "http://localhost:8080/api/v1/userData";
const USERDATA_API_ALL_URL = "http://localhost:8080/api/v1/users/";
const DEL_USERDATA_API_ALL_URL = "http://localhost:8080/api/v1/delUserData/";
//

class UserDataService {
    saveDataService(userData){
        return  axios.post(USERDATA_API_BASE_URL, userData);
    }

    allUserData(){
        return  axios.get(USERDATA_API_ALL_URL);
    }

    updateUserData(userData){
        return  axios.put(USERDATA_API_BASE_URL, userData);
    }

    deleteUserData(id){
        return  axios.delete(DEL_USERDATA_API_ALL_URL + "/" + id);
    }
}
export default new UserDataService();
